import React, { Component } from 'react';
import API from '../../backend/API';

class Home extends Component{
  state = {
    usage: []
  };

  componentDidMount(){
    API.get('/usage').then(result =>
      this.setState(() => ({
        usage: result.data
      }))
    );
    API.get('/usage').then(result => console.log(result.data));
  }

  render(){
    return(
      <div>
        <h3>Home View</h3>
        <p>{this.state.usage[0].free_bikes}</p>
      </div>
    )
  }
};

export default Home;
